{
  "name": "UBX-LOG-CREATE",
  "description": "Create log file",
  "message_type": "command",
  "class_id": "0x21",
  "message_id": "0x07",
  "payload_length": {
    "fixed": 8
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "version",
      "description": "Message version",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "data_type": "X1",
      "name": "logCfg",
      "description": "Config flags (see graphic below)"
    },
    {
      "byte_offset": 2,
      "data_type": "U1",
      "name": "reserved1",
      "reserved": true,
      "description": "Reserved"
    },
    {
      "byte_offset": 3,
      "data_type": "U1",
      "name": "logSize",
      "description": "Indicates the size of the log: 0 (maximum safe size): Ensures that logging will not be interrupted and enough space will be left available for all other uses of the filestore. 1 (minimum size). 2 (user-defined): See 'userDefinedSize' below"
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "userDefinedSize",
      "unit": "bytes",
      "description": "Sets the maximum amount of space in the filestore that can be used by the logging task. This field is only applicable if logSize is set to user-defined."
    }
  ]
}
